import { Navigate } from "react-router-dom";

export const Login = ({ loggedIn, checkFingerprint, isDoctor, name }) => {
    return (
        <div>
            {loggedIn ? (
                isDoctor ? (
                    <Navigate to="/doctor" />
                ) : (
                    <Navigate to="/patient" />
                )
            ) : (
                <div className="w-screen h-screen flex items-center justify-center">
                    <button className='rounded-xl flex flex-row items-center gap-2 text-lg tracking-wider text-sm px-5 py-3 w-max logInBtn' onClick={checkFingerprint}>Check Fingerprint</button>
                </div>
            )}
        </div>
    );
};
